import React from "react";
import Accueil from "./Accueil";
import Register from "./Register";
import {withRouter} from "react-router-dom";

// const {params } = useParams();
// console.log(this.props.hisotry);


class Routing extends React.Component{
    constructor(props){
        super(props)
    }
    // componentDidMount(){
        
    // }

    routeToComponent(){
        let categoryArticle = this.props.params.category;

        switch(categoryArticle){
            case category:
                <Accueil category={categoryArticle}/>
            break;
            default:
                <Accueil category={"all"}/>
        }

        
    }

    render(){
        return(
            <div>
                {this.routeToComponent()}
            </div>
        )
    }
}

export default withRouter(Routing)
